import { Icon } from '@material-ui/core';
import React from 'react';

export const SideBarData = [
    {
        title: 'Dashboard',
        // icon: <DashboardIcon />,
        path: "/",
        cName: 'nav-text'
    },
    {
        title: "Manage Accounts",
        // icon: <ManageAccountsIcon />,
        path: "/accounts",
        cName: 'nav-text'
    },
    {
        title: "Manage Materials",
        // icon: <DashboardIcon />,
        path: "/materials",
        cName: 'nav-text'
    },
    {
        title: "Manage Products",
        // icon: <DashboardIcon />,
        path: "/products",
        cName: 'nav-text'
    },
    {
        title: "Manage Components",
        // icon: <DashboardIcon />,
        path: "/components",
        cName: 'nav-text'
    },
]
